social_posts.post_text:
@rickie_runningsolo and I recently had the chance to take our modernized Fast & Furious inspired Mk4 Supra to “Torreto’s Market & cafe” in L.A.  Every time I visit here I’m reminded of all the good memories from that period in my life. Times that have shaped who I am and what I’m doing today, as my career! Along the way that day, we Laird a visit to my hood friends, @greddykenji at @greddyperformance and @revjunky at @spoonsportsusa. Even ran into @ed_funk from @titan7wheels which was an awesome surprise! What a fun day. To see how it all turned out, click the link in my bio.

📸 @victordeleon.mov 

